(124, 1, '2022-09-11 15:10:46', '2022-09-11 15:10:46', '<!-- wp:paragraph -->\n<p><b>This is a sample page.</b></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><h3>Overview</h3></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Our refund and returns policy lasts 30 days. If 30 days have passed since your purchase, we cant offer you a full refund or exchange.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>To be eligible for a return, your item must be unused and in the same condition that you received it. It must also be in the original packaging.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Several types of goods are exempt from being returned. Perishable goods such as food, flowers, newspapers or magazines cannot be returned. We also do not accept products that are intimate or sanitary goods, hazardous materials, or flammable liquids or gases.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Additional non-returnable items:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>Gift cards</li><li>Downloadable software products</li><li>Some health and personal care items</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>To complete your return, we require a receipt or proof of purchase.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Please do not send your purchase back to the manufacturer.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>There are certain situations where only partial refunds are granted:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>Book with obvious signs of use</li><li>CD, DVD, VHS tape, software, video game, cassette tape, or vinyl record that has been opened.</li><li>Any item not in its original condition, is damaged or missing parts for reasons not due to our error.</li><li>Any item that is returned more than 30 days after delivery</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p><h2>Refunds</h2></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Once your return is received and inspected, we will send you an email to notify you that we have received your returned item. We will also notify you of the approval or rejection of your refund.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you are approved, then your refund will be processed, and a credit will automatically be applied to your credit card or original method of payment, within a certain amount of days.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><b>Late or missing refunds</b></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you havent received a refund yet, first check your bank account again.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Then contact your credit card company, it may take some time before your refund is officially posted.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Next contact your bank. There is often some processing time before a refund is posted.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If youve done all of this and you still have not received your refund yet, please contact us at {email address}.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><b>Sale items</b></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Only regular priced items may be refunded. Sale items cannot be refunded.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><h2>Exchanges</h2></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We only replace items if they are defective or damaged. If you need to exchange it for the same item, send us an email at {email address} and send your item to: {physical address}.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><h2>Gifts</h2></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If the item was marked as a gift when purchased and shipped directly to you, youll receive a gift credit for the value of your return. Once the returned item is received, a gift certificate will be mailed to you.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If the item wasnt marked as a gift when purchased, or the gift giver had the order shipped to themselves to give to you later, we will send a refund to the gift giver and they will find out about your return.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><h2>Shipping returns</h2></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>To return your product, you should mail your product to: {physical address}.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>You will be responsible for paying for your own shipping costs for returning your item. Shipping costs are non-refundable. If you receive a refund, the cost of return shipping will be deducted from your refund.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Depending on where you live, the time it may take for your exchanged product to reach you may vary.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you are returning more expensive items, you may consider using a trackable shipping service or purchasing shipping insurance. We dont guarantee that we will receive your returned item.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><h2>Need help?</h2></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Contact us at {email} for questions related to refunds and returns.</p>\n<!-- /wp:paragraph -->', 'Chnh sch i tr hng', '', 'inherit', 'closed', 'closed', '', '10-revision-v1', '', '', '2022-09-11 15:10:46', '2022-09-11 15:10:46', '', 10, 'http://localhost/icybernet/?p=124', 0, 'revision', '', 0),
(133, 1, '2022-09-29 14:33:59', '2022-09-29 14:33:59', '<p>Cp sc Remax RC-119i vi thit k u cm ch L c o s mang n s tin li cn thit trong qu trnh sc v s dng ca ngi dng.</p>\n<p> Cp u l</p>\n<p>Nu ni im ni tri nht ca chic cp sc Remax RC-119i ngoi yu t v hiu nng sc v truyn d liu th c l thit k u sc hnh ch L l yu t kh c th b qua.</p>\n<p>Thay v thit k thng nh cp bnh thng, RC-119i chi ni bng cch cho u sc ch L. c im ca chic cp sc ny l khi cm vo thit b, n s khng li ra nhiu nh cp thng. Gip cho tng th gon v an ton hn. ng thi, ngi dng c th cm thit b  mi t th, ngang, dc m khng lo vng vu. (iu ny hon ton tin li cho nhng ai va chi game va cm sc)</p>\n<p> Dy vi bc l xo<br />\nKhng th ph nhn, ngay t ci nhn u tin, chic cp Remax RC-119i c thit k dy kh c o. Khng thun mi bc vi nh nhng chic cp thng thng khc,  2 phn u cm ca dy cn c bc mt lp l xo xung quanh vi tc dng chng t ngm.</p>\n<p>D  lp l xo bn ngoi gn nh tip xc trc tip vi u cm USB, th nhng, ngi dng c th yn tm bi Remax  x l cch in v cch nhit  bn trong. Khng c tnh trng dng in chy qua khi bn ang kt ni vi my tnh v c sc, m bo an ton khi s dng.</p>\n<p>Lp vi bn ngoi dy sc c bn kh p mt v d nhin l tit din ca dy s em n cm gic chc chn, khng d bung trong qu trnh s dng.</p>\n<p>Xt v tng th, b ngoi ca chic cp Remax RC-119i  c ti u ha v thit k vt tri hn hn so vi nhng chic cp thng. Va m bo c yu t p, thm m, va m bo cho chic cp c s dng lu hn, an ton hn vi ngi dng. iu quan trng tip theo l ngi dng nn xem xt hiu nng sc v truyn d liu ca chic cp sc ny.</p>\n<p> H tr sc nhanh 2.4A, n nh v an ton<br />\nSo vi mt chic cp zin theo my, Remax RC-119i n t khng ch v thit k m ngay c hiu nng sc. Nn nh, ngun ra ti a m chic cp sc ny s hu l 2.4A mt con s khng h nh so vi nhng cp sc thng thng khc. iu ny cng ng ngha vi vic, thi gian sc thit b s c rt ngn hn v tt nhin, qu trnh sc n nh v an ton cho thit b ln cp sc ca bn.<br />\nBn cnh kh nng sc, Remax RC-119i vn lm trn vai vi kh nng truyn d liu nhanh v n nh vi tc  ln n 480Mb/s.</p>\n<p style=\"padding-left: 240px;\"><iframe title=\"YouTube video player\" src=\"https://www.youtube.com/embed/iouvpSaK__4\" width=\"560\" height=\"315\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\n<p> Kt lun:<br />\nRemax RC-119i l mt sn phm hi t c c 2 yu t cn thit v chc nng bn trong v thit k bn ngoi. Cht lng sc v truyn d liu ca chic cp sc ny c kt qu khng km so vi si cp zin i km my. Mt sn phm ng tin  sm cho thit b ca mnh.</p>\n<p>#daysacnhanh12w #capsac12w #capsacnhanh #daycapsacnhanh #capsacnhanhremax12w #sacnhanh12w #Remax #CapRemax #Sacremax #capsacnhanhremax #capsacremax #daysacnhanh #capsacnhanhchinhhang #daysacnhanhchinhhang #capsacnhanhremax #daysacnhanhremax #sacnhanhchinhhang #sacnhanh1m #daysacnhanhremax #daysacremax #capsacremax&lt;/p&gt;&lt;/div&gt;&lt;/div&gt;</p>', 'Dy Sc Nhanh Chnh Hng Remax RC-119i Qup L - Cp Sc Nhanh 12w cho 13 pro max tr xung Chng Gy Gp - Bo Hnh 12T', '<p>This comfortable cotton crop-top features the Divi Engine logo on the front expressing how easy \"data Divi Engine life\" is. It is the perfect tee for any occasion.</p><p>This comfortable cotton crop-top features the Divi Engine logo on the front expressing how easy \"data Divi Engine life\" is. It is the perfect tee for any occasion.</p>', 'inherit', 'closed', 'closed', '', '103-autosave-v1', '', '', '2022-09-29 14:33:59', '2022-09-29 14:33:59', '', 103, 'http://localhost/icybernet/?p=133', 0, 'revision', '', 0),
